import React, {Component} from 'react';

import './contact.css';
import NavbarDefault from './components/navbar/navbar_default';

class Contact extends Component{
  constructor(props) {
    super(props)
  }

  render() {
    return(
      <div className="container">
        <NavbarDefault />
        <div class="jumbotron contact">
        <h1 class="display-4">Oh, another one!</h1>
        <p class="lead">Born somewhere, raised in a bunch of different places</p>
        <p class="lead">
          <a href="https://www.instagram.com/oh_another_one/" role="button">
          <img src="./public/materials/instagram-logo-circle.png" alt="instagram"/>
          </a>
          </p>
        </div>
      </div>
    )
  }
}

export default Contact
